css:
@-moz-document regexp(".*neptun.*")
{
  .main_header_r
  {
    background-image: url('https://imgur.com/b2k87AE.jpg');
  }

  .main_header_m
  {
    background-image: url('https://imgur.com/cDO7Jtw.jpg');
  }

  .main_header_l
  {
    background-image: url('https://imgur.com/yN3Bc7S.png');
  }

  div.infopanel_icon,
div.infopanel_icon_warning
  {
    background-image: url('https://imgur.com/MRASxRm.png');
  }

  .KollabChooser a
  {
    color: #525659;
    display: none;
    text-decoration: none;
  }

  #Image2,
#imganimation
  {
    display: none;
  }

  .modalBckgroundMain
  {
    background-color: #C0C0C0B9;
    opacity: 1;
  }

  #imgdiv,
#h_addsubjects_gridSubjects_animation,
#loginWaitAnimation
  {
    margin: auto !important;
    background-image: url('https://imgur.com/ru6JHdo.gif') !important;
    width: 200px !important;
    height: 200px !important;
  }

  #div_login_right_side
  {
    background-image: url('https://imgur.com/c3eKjk6.png') !important;
  }

  #td_LeftImage
  {
    background-image: url('https://imgur.com/kRMJSEY.png');
  }

  #td_Logo
  {
    background-image: url('https://imgur.com/6uOXIuU.png');
  }

  .login_background_table
  {
    width: 100%;
    border: 0px;
    margin: 0px;
    padding: 0px;
    background-repeat: repeat-x;
    /* background-color: gray; */
    border-collapse: collapse;
    border: 0px;
    text-align: center;
    background-color: #fe0000;
  }

  .footer_mid
  {
    background-image: url('https://imgur.com/cDO7Jtw.png');
  }

  .footer_menu
  {
    background-image: url('https://imgur.com/v6n6UgN.png');
  }

  .top_menu_mid
  {
    background-image: url('https://imgur.com/aJDGcPM.png');
  }

  .login_center
  {
    background-color: red;
    color: yellow;
  }

  .login_top_side
  {
    background-color: red;
  }

  .login_content_separator
  {
    background-color: red !important;
    background-image: none;
  }

  .login_info_text
  {
    color: yellow;
  }

  .login_content_docs
  {
    color: yellow;
  }

  .sr_detect
  {
    color: red;
  }

  .login_top_side
  {
    background-color: red;
    color: red;
  }

  .login_news_subject label + a
  {
    color: yellow;
  }

  .login_content_news
  {
    color: yellow;
  }

  .login_docs a
  {
    color: yellow;
  }

  .login_news_date
  {
    color: yellow;
  }

  .login_news_content
  {
    color: yellow;
  }

  .login_news_more a
  {
    background-color: yellow;
    color: red;
  }

  .login_content_links
  {
    color: yellow;
  }

  .login_links a
  {
    color: yellow;
  }

  .login_top_side span[orgid="hallgato_custom"]
  {
    color: yellow;
  }
}
